import React, { Component } from "react";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";
import { Container, Row, Col } from "reactstrap";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import Select from "react-select";
import ListGroup from "react-bootstrap/ListGroup";
import DayPickerInput from "react-day-picker/DayPickerInput";

const scaryAnimals = [
    { label: "Alligators", value: 1 },
    { label: "Crocodiles", value: 2 },
    { label: "Sharks", value: 3 },
    { label: "Small crocodiles", value: 4 },
    { label: "Smallest crocodiles", value: 5 },
    { label: "Snakes", value: 6 }
  ];

class IncluirMovimentacao extends Component {
  constructor(props) {
    super(props);
  }
  state = {
    listitems: [
      { name: "shashank", age: 20 },
      { name: "vardan", age: 30 },
      { name: "somya", age: 40 }
    ],
    value: "",
    NumeroDocumento: ""
  };
  render() {
    return (
      <div>
        <h1>Incluir Movimentação</h1>
        <Container>
          <Row>
            <Col md={12}>
              <Card>
                <Card.Body>
                <Row>
                    <Col md={3}>
                      <label>Matriz Contábil</label>
                      <div className="container">
                        <Select options={scaryAnimals} />
                      </div>
                      <ListGroup>
                        {this.state.listitems.map((listitem, index) => (
                          <ListGroup.Item key={index}>
                            {listitem.name} <Button variant="primary">X</Button>
                          </ListGroup.Item>
                        ))}
                      </ListGroup>
                    </Col>
                    <Col md={3}>
                      <label>Filial</label>
                      <div className="container">
                        <Select options={scaryAnimals} />
                      </div>
                      <ListGroup>
                        {this.state.listitems.map((listitem, index) => (
                          <ListGroup.Item key={index}>
                            {listitem.name} <Button variant="primary">X</Button>
                          </ListGroup.Item>
                        ))}
                      </ListGroup>
                    </Col>
                    <Col md={3}>
                      <label>Conta Corrente</label>
                      <div className="container">
                        <Select options={scaryAnimals} />
                      </div>
                      <ListGroup>
                        {this.state.listitems.map((listitem, index) => (
                          <ListGroup.Item key={index}>
                            {listitem.name} <Button variant="primary">X</Button>
                          </ListGroup.Item>
                        ))}
                      </ListGroup>
                    </Col>
                    <Col md={3}>
                      <label>Conta Despesa</label>
                      <div className="container">
                        <Select options={scaryAnimals} />
                      </div>
                      <ListGroup>
                        {this.state.listitems.map((listitem, index) => (
                          <ListGroup.Item key={index}>
                            {listitem.name} <Button variant="primary">X</Button>
                          </ListGroup.Item>
                        ))}
                      </ListGroup>
                    </Col>
                  </Row>
                </Card.Body>
              </Card>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

function mapDispatchToProps(dispatch) {
  return bindActionCreators({}, dispatch);
}
export default connect(null, mapDispatchToProps)(IncluirMovimentacao);
